    render() {
        console.log(this.props)
        return (
            <div style={{ marginTop: "5vh", marginBottom: "5vh" }}>
                <Container>
                    <div className="row p-3">
                        <div className="col-md-12">
                            <h2 className="text-left">Kategori</h2>
