                            <Link to="/category/sci-fi" >Sci-Fi</Link>
                        </li>
                        <li className="list-group-item">
                            <Link to="/category/horror" >Horror</Link>
                        </li>
                        <li className="list-group-item">
                            <Link to="/category/action" >Action</Link>
                        </li>
                        <li className="list-group-item">
                            <Link to="/category/thriller" >Thriller</Link>
                        </li>
                    </ul>
                </Container>
            </div>
        );
    }
}

export default Categories;
